        function groupByTitle(data) {
            const groups = {};

            data.forEach(item => {
                const { unitName, lectureTitle, handout1Url, s3LinkLow } = item.data;
                if (!groups[unitName]) {
                    groups[unitName] = [];
                }
                groups[unitName].push({ lectureTitle, handout1Url, s3LinkLow });
            });

            return groups;
        }

        function renderTopics(groups) {
            const container = document.getElementById('topics-container');
            container.innerHTML = '';

            for (const [title, topics] of Object.entries(groups)) {
                const groupElement = document.createElement('div');
                groupElement.classList.add('topic-group');

                const titleElement = document.createElement('div');
                titleElement.classList.add('group-title');
                titleElement.textContent = title;
                titleElement.addEventListener('click', () => {
                    const content = groupElement.querySelector('.topic-content');
                    if (content.style.display === 'block') {
                        content.style.display = 'none';
                    } else {
                        content.style.display = 'block';
                    }
                });

                const contentElement = document.createElement('div');
                contentElement.classList.add('topic-content');

                topics.forEach(topic => {
                    const topicElement = document.createElement('div');
                    topicElement.classList.add('topic');
                    let linksHTML = '';
                    if (topic.handout1Url) {
                        linksHTML += `<a href="${topic.handout1Url}" rel="noreferrer" target="_blank">PDF Link</a>`;
                    }
                    if (topic.s3LinkLow) {
                        linksHTML += `<a href="${topic.s3LinkLow}" rel="noreferrer" target="_blank">Video Link</a>`;
                    }

                    topicElement.innerHTML = `
                        <div class="subtitle">${topic.lectureTitle}</div>
                        <div class="links">
                            ${linksHTML}
                        </div>
                    `;
                    contentElement.appendChild(topicElement);
                });

                groupElement.appendChild(titleElement);
                groupElement.appendChild(contentElement);
                container.appendChild(groupElement);
            }
        }

        const groupedData = groupByTitle(data);
        renderTopics(groupedData);
    </script>
